import Profile from './component/profile';
import './profile.css'
import Linker from './component/links';
import './links.css'
import Footer from './component/footer';
import './footer.css'
import Socials from './component/socials';
import './social.css'
import {BrowserRouter} from 'react-router-dom'



function App(){
    return(
        <BrowserRouter>
            <div className='App'>
            <Profile />
            <Linker  />
            <Socials />
            <Footer />
        </div>
        
        </BrowserRouter>
    )
}

export default App
